ps://www.w3schools.com/php/php_ref_output_control.asp\" target=\"_top\">PHP Output Control</a><a href=\"https://www.w3schools.com/php/php_ref_regex.asp\" target=\"_top\">PHP RegEx</a><a href=\"https://www.w3schools.com/php/php_ref_simplexml.asp\" target=\"_top\">PHP SimpleXML</a><a href=\"https://www.w3schools.com/php/php_ref_stream.asp\" target=\"_top\">PHP Stream</a><a href=\"https://www.w3schools.com/php/php_ref_string.asp\" target=\"_top\">PHP String</a><a href=\"https://www.w3schools.com/php/php_ref_variable_handling.asp\" target=\"_top\">PHP Variable Handling</a></p>\r\n\r\n<p><a href=\"https://www.w3schools.com/php/func_var_boolval.asp\" target=\"_top\">boolval()</a><a href=\"https://www.w3schools.com/php/func_var_debug_zval_dump.asp\" target=\"_top\">debug_zval_dump()</a><a href=\"https://www.w3schools.com/php/func_var_doubleval.asp\" target=\"_top\">doubleval()</a><a href=\"https://www.w3schools.com/php/func_var_is_countable.asp\" target=\"_top\">is_countable()</a><a href=\"https://www.w3schools.com/php/func_var_empty.asp\" target=\"_top\">empty()</a><a href=\"https://www.w3schools.com/php/func_var_floatval.asp\" target=\"_top\">floatval()</a><a href=\"https://www.w3schools.com/php/func_var_get_defined_vars.asp\" target=\"_top\">get_defined_vars()</a><a href=\"https://www.w3schools.com/php/func_var_get_resource_type.asp\" target=\"_top\">get_resource_type()</a><a href=\"https://www.w3schools.com/php/func_var_gettype.asp\" target=\"_top\">gettype()</a><a href=\"https://www.w3schools.com/php/func_var_intval.asp\" target=\"_top\">intval()</a><a href=\"https://www.w3schools.com/php/func_var_is_array.asp\" target=\"_top\">is_array()</a><a href=\"https://www.w3schools.com/php/func_var_is_bool.asp\" target=\"_top\">is_bool()</a><a href=\"https://www.w3schools.com/php/func_var_is_callable.asp\" target=\"_top\">is_callable()</a><a href=\"https://www.w3schools.com/php/func_var_is_double.asp\" target=\"_top\">is_double()</a><a href=\"https://www.w3schools.com/php/func_var_is_float.asp\" target=\"_top\">is_float()</a><a href=\"https://www.w3schools.com/php/func_var_is_int.asp\" target=\"_top\">is_int()</a><a href=\"https://www.w3schools.com/php/func_var_is_integer.asp\" target=\"_top\">is_integer()</a><a href=\"https://www.w3schools.com/php/func_var_is_iterable.asp\" target=\"_top\">is_iterable()</a><a href=\"https://www.w3schools.com/php/func_var_is_long.asp\" target=\"_top\">is_long()</a><a href=\"https://www.w3schools.com/php/func_var_is_null.asp\" target=\"_top\">is_null()</a><a href=\"https://www.w3schools.com/php/func_var_is_numeric.asp\" target=\"_top\">is_numeric()</a><a href=\"https://www.w3schools.com/php/func_var_is_object.asp\" target=\"_top\">is_object()</a><a href=\"https://www.w3schools.com/php/func_var_is_real.asp\" target=\"_top\">is_real()</a><a href=\"https://www.w3schools.com/php/func_var_is_resource.asp\" target=\"_top\">is_resource()</a><a href=\"https://www.w3schools.com/php/func_var_is_scalar.asp\" target=\"_top\">is_scalar()</a><a href=\"https://www.w3schools.com/php/func_var_is_string.asp\" target=\"_top\">is_string()</a><a href=\"https://www.w3schools.com/php/func_var_isset.asp\" target=\"_top\">isset()</a><a href=\"https://www.w3schools.com/php/func_var_print_r.asp\" target=\"_top\">print_r()</a><a href=\"https://www.w3schools.com/php/func_var_serialize.asp\" target=\"_top\">serialize()</a><a href=\"https://www.w3schools.com/php/func_var_settype.asp\" target=\"_top\">settype()</a><a href=\"https://www.w3schools.com/php/func_var_strval.asp\" target=\"_top\">strval()</a><a href=\"https://www.w3schools.com/php/func_var_unserialize.asp\" target=\"_top\">unserialize()</a><a href=\"https://www.w3schools.com/php/func_var_unset.asp\" target=\"_top\">unset()</a><a href=\"https://www.w3schools.com/php/func_var_var_dump.asp\" target=\"_top\">var_dump()</a><a href=\"https://www.w3schools.com/php/func_var_var_export.asp\" target=\"_top\">var_export()</a></p>\r\n\r\n<p><a href=\"https://www.w3schools.com/php/php_ref_xml.asp\" target=\"_top\">PHP XML Parser</a><a href=\"https://www.w3schools.com/php/php_ref_zip.asp\" target=\"_top\">PHP Zip</a><a href=\"https://www.w3schools.com/php/php_ref_timezones.asp\" target=\"_top\">PHP Timezones</a><br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1>PHP&nbsp;strval()&nbsp;Function</h1>\r\n\r\n<p><a href=\"https://www.w3schools.com/php/php_ref_variable_handling.asp\">❮ PHP Variable Handling Reference</a></p>\r\n\r\n<h3>Example</h3>\r\n\r\n<p>Return the string value of different variables:</p>\r\n\r\n<p>&lt;?php<br />\r\n$a =&nbsp;&quot;Hello&quot;;<br />\r\necho&nbsp;strval($a) .&nbsp;&quot;&lt;br&gt;&quot;;<br />\r\n<br />\r\n$b =&nbsp;&quot;1234.56789&quot;;<br />\r\necho&nbsp;strval($b) .&nbsp;&quot;&lt;br&gt;&quot;;<br />\r\n<br />\r\n$c =&nbsp;&quot;1234.56789Hello&quot;;<br />\r\necho&nbsp;strval($c) .&nbsp;&quot;&lt;br&gt;&quot;;<br />\r\n<br />\r\n$d =&nbsp;&quot;Hello1234.56789&quot;;<br />\r\necho&nbsp;strval($d) .&nbsp;&quot;&lt;br&gt;&quot;;<br />\r\n<br />\r\n$e =&nbsp;1234;<br />\r\necho&nbsp;strval($e) .&nbsp;&quot;&lt;br&gt;&quot;;<br />\r\n?&gt;</p>\r\n\r\n<p><a href=\"https://www.w3schools.com/php/phptryit.asp?filename=tryphp_func_var_strval\" target=\"_blank\">Try it Yourself &raquo;</a></p>\r\n\r\n<hr />\r\n<h2>Definition and Usage</h2>\r\n\r\n<p>The strval() function returns the string value of a variable.</p>\r\n\r\n<hr />\r\n<h2>Syntax</h2>\r\n\r\n<p>strval(<em>variable</em>);</p>\r\n\r\n<h2>Parameter Values</h2>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<th>Parameter</th>\r\n			<th>Description</th>\r\n		</tr>\r\n		<tr>\r\n			<td><em>variable</em></td>\r\n			<td>Required. Specifies the variable to check</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<h2>Technical Details</h2>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<th>Return Value:</th>\r\n			<td>The string value of the&nbsp;<em>variable</em>&nbsp;on success</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Return Type:</th>\r\n			<td>String</td>\r\n		</tr>\r\n		<tr>\r\n			<th>PHP Version:</th>\r\n			<td>4.0+</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<hr />\r\n<p><a href=\"https://www.w3schools.com/php/php_ref_variable_handling.asp\">❮ PHP Variable Handling Reference</a></p>\r\n\r\n<p>ADVERTISEMENT</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>NEW</p>\r\n\r\n<p>We just launched<br />\r\nW3Schools videos</p>\r\n\r\n<p><a href=\"https://www.w3schools.com/videos/index.php\" onclick=\"ga(\'send\', \'event\', \'Videos\' , \'fromSidebar\');\"><img src=\"https://www.w3schools.com/images/htmlvideoad_footer.png\" /></a><a href=\"https://www.w3schools.com/videos/index.php\" onclick=\"ga(\'send\', \'event\', \'Videos\' , \'fromSidebar\');\">Explore now</a></p>\r\n\r\n<p><a href=\"https://www.w3schools.com/colors/colors_picker.asp\">COLOR PICKER</a></p>\r\n\r\n<p><a href=\"https://www.w3schools.com/colors/colors_picker.asp\"><img alt=\"colorpicker\" src=\"https://www.w3schools.com/images/colorpicker2000.png\" /></a></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>Get certified<br />\r\nby completing<br />\r\na course today!</p>\r\n\r\n<p><a href=\"https://courses.w3schools.com/\" onclick=\"ga(\'send\', \'event\', \'Courses\' , \'Clicked on courses banner in ads column\');\" target=\"_blank\">w3schoolsCERTIFIED.2022</a></p>\r\n\r\n<p><a href=\"https://courses.w3schools.com/\" onclick=\"ga(\'send\', \'event\', \'Courses\' , \'Clicked on courses banner in ads column\');\" target=\"_blank\">Get started</a></p>\r\n\r\n<p><a href=\"https://www.w3schools.com/codegame/index.html\">CODE GAME</a></p>\r\n\r\n<p><a href=\"https://www.w3schools.com/codegame/index.html\" target=\"_blank\"><img alt=\"Code Game\" src=\"https://www.w3schools.com/images/w3lynx_200.png\" /></a><a href=\"https://www.w3schools.com/codegame/index.html\" target=\"_blank\">Play Game</a></p>\r\n\r\n<p>ADVERTISEMENT</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ADVERTISEMENT</p>\r\n\r\n<hr />\r\n<p><a href=\"javascript:void(0);\" onclick=\"displayError();return false\">Report Error</a></p>\r\n\r\n<p><a h